import { Button } from "@material-ui/core";
import React from "react";
import AddIcon from "@material-ui/icons/Add";
import "./dashbord.css";
import DragHandleIcon from "@material-ui/icons/DragHandle";
import ClearIcon from "@material-ui/icons/Clear";
import RemoveIcon from "@material-ui/icons/Remove";
import Grid from "@material-ui/core/Grid";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
}));
const Dashbord = () => {
  const classes = useStyles();
  return (
    <div className={[classes.root && "dashbord"]}>
      <Grid container spacing={2} container
  direction="column"
  justify="flex-start"
  alignItems="stretch">
        <Grid item xs={10} className="answer">
          0
        </Grid>
        <Grid item xs={10} className="literals">
        <Grid item xs={4}className="part1">
            <Button>
              <AddIcon />
            </Button>
            <Button>
              <DragHandleIcon />
            </Button>
            <Button>
              <RemoveIcon />
            </Button>
            <Button>
              <ClearIcon />
            </Button>
          </Grid>
          <Grid item xs={8} className="part2">
            <Button>1</Button>
            <Button>2</Button>
            <Button>3</Button>
            <Button>4</Button>
            <Button>5</Button>
            <Button>6</Button>
            <Button>7</Button>
            <Button>8</Button>
            <Button>9</Button>
            <Button>0</Button>
            <Button>.</Button>
          </Grid>
        </Grid>
      </Grid>
    </div>
  );
};
export default Dashbord;
